    // Inicializar servicio de bluetooth ble
    private final ServiceConnection mServiceConnection = new ServiceConnection() {
        @Override
        public void onServiceConnected(ComponentName componentName, IBinder binder) {
            bluetoothLeService = ((BluetoothLeService.LocalBinder) binder).getService();
            if (!bluetoothLeService.initialize()) {
                Toast.makeText(context, "Unable to initialize Bluetooth", Toast.LENGTH_SHORT).show();
            }
            // Automatically connects to the device upon successful start-up initialization.
            bluetoothLeService.connect(mac);
        }
        @Override
        public void onServiceDisconnected(ComponentName componentName) {
            bluetoothLeService = null;
        }
    };

    // Handles various events fired by the Service.
    // ACTION_GATT_CONNECTED: connected to a GATT server.
    // ACTION_GATT_DISCONNECTED: disconnected from a GATT server.
    // ACTION_GATT_SERVICES_DISCOVERED: discovered GATT services.
    // ACTION_DATA_AVAILABLE: received data from the device.  This can be a result of read
    //                        or notification operations.
    private final BroadcastReceiver mGattUpdateReceiver = new BroadcastReceiver() {
        @Override
        public void onReceive(Context context, Intent intent) {
            final String action = intent.getAction();
            if (BluetoothLeService.ACTION_GATT_CONNECTED.equals(action)) {
                Log.d("ACTION_GATT_SERV_DSORED","CONECTADO");
                tvconnectionState.setText("Conectado a:\n"+mac);
                tvconnectionState.setTextColor(Color.parseColor("#00a135"));
                esp.putString("mac",mac);
                connected();
                esp.apply();
            } else if (BluetoothLeService.ACTION_GATT_DISCONNECTED.equals(action)) {
                Log.d("ACTION_GATT_SERV_DSORED","DESCONECTADO");
                tvconnectionState.setText("Desconectado");
                tvconnectionState.setTextColor(Color.BLACK);
                tvfwversion.setText("");
                esp.putString("mac","");
                esp.apply();
                disconnect();
            } else if (BluetoothLeService.ACTION_GATT_SERVICES_DISCOVERED.equals(action)) {
                // Show all the supported services and characteristics on the user interface.
                Log.d("ACTION_GATT_SERV_Dicovered","TRUE");
            } else if (BluetoothLeService.ACTION_DATA_AVAILABLE.equals(action)) {
                String data =intent.getStringExtra(BluetoothLeService.EXTRA_DATA);
            }
        }
    };

